export default function Home({ inputUsername, handleUsernameChange, handleConfirmUser}) {
    return (
      <div className="home">
        {inputUsername ? (
            <h2>Welcome, {inputUsername}</h2>
        ) : (
            <>
              <h2>Welcome</h2>
              <div className="input-group">
                <input
                  type="text"
                  value={inputUsername}
                  onChange={handleUsernameChange}
                  className="username-input"
                  placeholder="username"
                />
                <button onClick={handleConfirmUser}>Confirm</button>
              </div>
            </>
        )}
      </div>
    );
}
